onClipEvent (load) {
	if (!_parent.落地 && _parent._currentframe == 82)
	{
		_parent.stop();
	}
}
onClipEvent (enterFrame) {
	if (_parent.落地)
	{
		_parent.gotoAndPlay("崩山击已落地");
	}
	else
	{
		//_parent.滞空时间 += 1;
		//if(_parent.跳跃移动倍率 > 0.5){
			//_parent.跳跃移动倍率 -= 0.2;
			_parent._parent.垂直速度 += 3;
		//}
	}
}
onClipEvent (unload) {
	_parent.跳跃移动倍率 = 1;
	//_parent.gotoAndPlay("崩山击已落地");
}

if(_parent.垂直速度 < - _parent.起跳速度 * 0.8){
	_parent.垂直速度 =  - _parent.起跳速度 * 0.8;
}
跳跃移动倍率 = 1;
滞空时间 = 0;
坠地中 = true;
_parent.刚体 = true;
play();

if (!落地)
{
	gotoAndPlay("崩山击循环");
}

坠地中 = false;

_parent.动画完毕();
stop();

onClipEvent(load){
	子弹属性 = _root.子弹属性初始化(this);

	//以下部分只需要更改需要更改的属性,其余部分可注释掉
	子弹属性.声音 = "";
	子弹属性.霰弹值 = 1;
	子弹属性.子弹散射度 = 0;
	子弹属性.子弹种类 = "近战子弹";
	子弹属性.子弹威力 =  _parent._parent.空手攻击力 / 5 + _parent._parent.刀属性.power * 2;
	if (_parent._parent.mp攻击加成)
	{
		子弹属性.子弹威力 += _parent._parent.mp攻击加成 * 1;
	}
	if(_parent._parent.被动技能.上挑 && _parent._parent.被动技能.上挑.等级){
		子弹属性.子弹威力 +=   _parent._parent.刀属性.power *  _parent._parent.被动技能.上挑.等级 / 10;
	}
	子弹属性.子弹速度 = 0;
	子弹属性.Z轴攻击范围 = 30;
	子弹属性.击倒率 = 1;
	子弹属性.垂直击退速度 = 5;
	子弹属性.击中后子弹的效果 = "斩打命中特效";

	//非常用
	/*
	子弹属性.垂直击退速度 = NaN;
	子弹属性.发射效果 = "";
	子弹属性.击中地图效果 = "火花".
	子弹属性.命中率 = NaN.
	子弹属性.固伤 = NaN;
	子弹属性.百分比伤害 = NaN;
	子弹属性.血量上限击溃 = NaN;
	子弹属性.防御粉碎 = NaN;
	*/
	子弹属性.区域定位area = this.area;
	/*
	//已初始化内容，通常不需要重复赋值，可注释掉
	子弹属性.发射者 = 子弹属性.发射者.
	子弹属性.shootX = 子弹属性.shootX;
	子弹属性.shootY = 子弹属性.shootY;
	子弹属性.shootZ = 子弹属性.shootZ;
	子弹属性.子弹敌我属性 = 子弹属性.子弹敌我属性;
	*/
	_root.子弹区域shoot传递(子弹属性);
}

